INSERT INTO `wp_rbmbnbafrz_posts` VALUES(44, 1, '2020-05-06 14:13:29', '2020-05-06 14:13:29', '.header-inner.clear-fix {\n    box-shadow: 0 0 8px gray;\n}\n\n.header-wrap.header-center.header-black {\nbackground: rgb(174,209,230);\nbackground: linear-gradient(180deg, rgba(174,209,230,1) 0%, rgba(255,255,255,1) 100%);\n}\n\n.main-nav #main-menu .menu > li > a:hover {\n	background: #000000;\n	color: #0cb6ff;\n}\n\n.widget_nav_menu > div > ul > li > a {\n	border-top: 1px solid #717171;\n}\n\n.woocommerce ul.products li.product a img {\n	box-shadow: 0 0 5px gray;\n}\n\n#back-top {\n	right: 300px;\n}\n\n.tribe-events-widget-link a {\n	background: #0cb6ff;\n	color: white;\n	padding: 10px;\n}\n\n.tribe-common .tribe-common-c-btn,\n.tribe-common a.tribe-common-c-btn {\n	background-color: #0cb6ff;\n}', 'zalora-child', '', 'publish', 'closed', 'closed', '', 'zalora-child', '', '', '2020-05-07 19:10:53', '2020-05-07 19:10:53', '', 0, 'http://seanborg.eu/2020/05/zalora-child/', 0, 'custom_css', '', 0);
